// Navbar.js

import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';
import { FaUser, FaShoppingCart } from 'react-icons/fa'; // Icons for account and cart

const Navbar = () => {
    return (
        <nav className="navbar">
            {/* Logo */}
            <div className="logo">
                <Link to="/">
                    <img src="/path-to-your-logo.png" alt="Logo" width="150" />
                </Link>
            </div>

            {/* Centered Nav Links */}
            <ul className="nav-links">
                <li><Link to="/women">Women</Link></li>
                <li><Link to="/men">Men</Link></li>
                <li><Link to="/special-combos">Special Combos</Link></li>
                <li><Link to="/gift-sets">Gift Sets</Link></li>
                <li><Link to="/other-products">Other Products</Link></li>
                <li><Link to="/about">About</Link></li>
            </ul>

            {/* Right Side Icons */}
            <div className="right-icons">
                <FaUser className="icon" /> {/* Account Icon */}
                <FaShoppingCart className="icon" /> {/* Cart Icon */}
            </div>
        </nav>
    );
};

export default Navbar;
